import React, { useState } from 'react';
import { BrowserRouter as Router, Route, Routes } from 'react-router-dom';
import Navbar from './components/Navbar';
import Footer from './components/Footer';
import Home from './components/Home';
import Hospitals from './components/Hospitals';
import Medicals from './components/Medicals';
import Diagnostics from './components/Diagnostics';

function App() {
  const [searchResults, setSearchResults] = useState([]);

  const handleSearch = (query) => {
    const hospitals = [
      { id: 1, name: 'Holy Family Multispeciality Hospital', type: 'hospital' },
      { id: 2, name: 'Shruti Nursing Home', type: 'hospital' },
      { id: 3, name: 'Symbiosis Speciality Hospital', type: 'hospital' },
      { id: 4, name: 'Lilavati Hospital', type: 'hospital' },
    ];
    const medicals = [
      { id: 1, name: 'Bandra Medical Store', type: 'medical' },
      { id: 2, name: 'Shree Ganesh Medical', type: 'medical' },
      { id: 3, name: 'Care Chemist', type: 'medical' },
      { id: 4, name: 'Wellness Forever', type: 'medical' },
    ];
    const diagnostics = [
      { id: 1, name: 'Thyrocare Diagnostic Centre', type: 'diagnostic' },
      { id: 2, name: 'Suburban Diagnostics', type: 'diagnostic' },
      { id: 3, name: 'Dr. Lal PathLabs', type: 'diagnostic' },
    ];

    const allData = [...hospitals, ...medicals, ...diagnostics];
    const results = allData.filter(item => item.name.toLowerCase().includes(query.toLowerCase()));
    setSearchResults(results);
  };

  return (
    <Router>
      <div>
        <Navbar onSearch={handleSearch} />
        <Routes>
          <Route path="/" element={<Home searchResults={searchResults} />} />
          <Route path="/hospitals" element={<Hospitals />} />
          <Route path="/medicals" element={<Medicals />} />
          <Route path="/diagnostics" element={<Diagnostics />} />
        </Routes>
        <Footer />
      </div>
    </Router>
  );
}

export default App;
